// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.8.0;
contract Student {
uint public totalStudents;
string public name;
string public password;
string public dob;
string public addr;

address public owner;


struct st {
string  name;
string  password;
string  dob;
string  addr;
address ethaddr;
string role;
}
mapping (uint =>st) public students;
mapping(address =>bool) register;
mapping(address =>string) public roles;

constructor() public {
    name='';
    password='';
    dob='';
    addr='';
    owner=msg.sender;
    
}
function updateDetails  (string memory _name,string memory _pwd,string memory _dob,string memory _addr) public  {
        name=_name;
        password=_pwd;
        dob=_dob;
        addr=_addr;
}
function registerStudent  (string memory _name,string memory _pwd,string memory _dob,string memory _addr,string memory _role) public  {
        require(! register[msg.sender]);
        students[totalStudents++]=st(_name,_pwd,_dob,_addr,msg.sender,_role);
        register[msg.sender]=true;
        roles[msg.sender]=_role;
       

}
}
